    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service proposes
    to allow hunting of resident and migratory game species on three-quarters of the
    existing acreage of Marais des Cygnes NWR.  The proposed action is to implement
    a hunting program on Marais des Cygnes National Wildlife Refuge (MDC Refuge) to
    manage wildlife populations at optimum levels and provide recreational opportunities.
    Hunting will be in accordance with Kansas Department of Wildlife and Parks regulations
    with the addition of special refuge specific regulations. This Environmental Assessment
    contains the Finding of No Significant Impact (FONSI), Compatibility Determination,
    and the Section 7 Evaluation.",nt"license_title": "License Not Specified",nt"extras":
